import Brush from "./Brush";

export default class Eraser extends Brush {

    draw(x: number, y: number) {
        this.ctx.strokeStyle = "white"
        this.ctx.lineTo(x, y)
        this.ctx.stroke()
    }

    static drawStatic(ctx: any, x: number, y: number) {
        ctx.strokeStyle = "white"
        console.log(ctx)
        ctx.lineTo(x, y)
        ctx.stroke()
    }
}
